function searchSequenceInDict(dictionary, sequence) {
  const res = [];
  for (const [index, value] of Object.entries(dictionary)) {
    const valueStr = value;
    const sequenceStr = sequence;
    if (valueStr.includes(sequenceStr)) {
      res.push(index);
    }
  }
  return res;
}
